--
-- Create procedure `Proc_Employee_GetByEmployeeID`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetByEmployeeID (IN $EmployeeID char(36))
COMMENT 'Lấy dữ liệu 1 bản ghi nhân viên - Created By: NBDuong 06.07.2022'
BEGIN
  -- Lấy dữ liệu theo $EmployeeID truyền vào
  SELECT
    e.EmployeeID,
    e.EmployeeCode,
    e.EmployeeName,
    e.DateOfBirth,
    e.Gender,
    e.IdentityNumber,
    e.IdentityIssuedPlace,
    e.IdentityIssuedDate,
    e.Email,
    e.PhoneNumber,
    e.PositionID,
    e.DepartmentID,
    e.TaxCode,
    e.Salary,
    e.JoiningDate,
    e.WorkStatus,
    p.PositionName AS PositionName,
    d.DepartmentName AS DepartmentName,
    e.CreatedDate,
    e.CreatedBy,
    e.ModifiedDate,
    e.ModifiedBy
  FROM employee e
    INNER JOIN department d
      ON e.DepartmentID = d.DepartmentID
    INNER JOIN positions p
      ON e.PositionID = p.PositionID
  WHERE e.EmployeeID = $EmployeeID
  ;
END
$$

